// MyComponent.js
import React, {useState} from 'react';
import Draggable from 'react-draggable';

const TrainerSettingsWindow = () => {
    
    const [isVisible, setIsVisible] = useState(true);
    
    // Sample state variables for input values
    const [floatValue, setFloatValue] = useState(0.0);
    const [textValue, setTextValue] = useState('');
    const [isChecked, setIsChecked] = useState(false);

    
    const toggleVisibility = () => {
        setIsVisible(!isVisible);
    };
     
    return (
        <>
          <button onClick={toggleVisibility}>{isVisible ? 'Hide' : 'Show'}</button>
          {isVisible && (
            <Draggable>
              <div style={{ width: 200, height: 'auto', padding: 10, backgroundColor: '#f0f0f0', cursor: 'move' }}>
                <button onClick={toggleVisibility} style={{ marginBottom: '10px' }}>Close</button>
                <div>
                  <label>
                    Float: 
                    <input 
                      type="number" 
                      step="0.1" 
                      value={floatValue} 
                      onChange={e => setFloatValue(e.target.value)} 
                      style={{ marginLeft: '5px' }}
                    />
                  </label>
                </div>
                <div>
                  <label>
                    Text: 
                    <input 
                      type="text" 
                      value={textValue} 
                      onChange={e => setTextValue(e.target.value)} 
                      style={{ marginLeft: '5px' }}
                    />
                  </label>
                </div>
                <div>
                  <label>
                    Checkbox: 
                    <input 
                      type="checkbox" 
                      checked={isChecked} 
                      onChange={e => setIsChecked(e.target.checked)} 
                      style={{ marginLeft: '5px' }}
                    />
                  </label>
                </div>
                <p>Drag me around!</p>
              </div>
            </Draggable>
          )}
        </>
      );    
};

export default TrainerSettingsWindow;
